function openTab(e,t){const n=document.getElementsByClassName("tabcontent");for(let e=0;e<n.length;e++)n[e].style.display="none";const a=document.getElementsByClassName("tablinks");for(let e=0;e<a.length;e++)a[e].className=a[e].className.replace(" active","");const s=document.getElementById(t);s&&(s.style.display="block"),e&&(e.currentTarget.className+=" active")}addLoadEvent(()=>openTab(null,location.hash.substring(1)));